import C from '../../../actions/constants';

const initialState = {
    pageDetails: {
        page:0,
        count:10
    }
}





const reducer = (state = initialState, action) => {
    switch (action.type) {


            case C.PAGE_CHANGE:
                return initialState.page = action.payload
        default:
            return {
                ...state
            }
    }
}

export default reducer;
